export default function CreateGroup() {
    return (
        <div>
            <h1>Add a Room</h1>
            <form id="nameGame">
                <label>Name of Game</label>
                <input type="text" placeholder="Enter name of the game..." name="gameName"></input>
            </form>
        </div>
    );
}
